CREATE PROCEDURE [dbo].[Webshop_Add_History_Card] 
	@UserID int,
	@Coin int
AS
declare @thoigian datetime;
declare @content nvarchar(50);
declare @xu nvarchar(50);
set @xu = cast(@coin as nvarchar(50))
set @thoigian = GETDATE();
set @content = N'Nạp vào tài khoản '+@xu+N' Coin';
INSERT INTO Webshop_History(NoiDung,Coin,TimeSend,UserID) VALUES (@content,@Coin,@thoigian,@UserID);
GO
